    // Inget Ljud
    // Kolla volymkontrollen
    Gå till det högra hörnet på verktygsfältet och klicka på högtalaren. Om det ej är en synlig högtalare på verktygsfältet; klicka på pilen för att få upp en liten meny, där bör högtalaren finnas om den ej är synlig på själva verktygsfältet.
Klickar man på högtalaren så kommer man in på menyn som heter Volymkontrollen, checka först och främst om ljudet är avstängt, är ljudet helt avstängt så bör det vara en stoppskylt på högtalarikonen i verktygsfältet. Detta fixas enkelt av att klicka på högtalarikonen längst ned i volymkontrollen, fungerar inte det så kan ljudet vara satt på 0, vilket syns på sildern precis ovanför ikonen och fixas också väldigt enkelt genom att dra den uppåt. 

